# 3. Longest Substring Without Repeating Characters
# https://leetcode.com/problems/longest-substring-without-repeating-characters/


class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        i = 0
        j = 0
        n = len(s)
        result = 0
        d = {}
        while i < n and j < n:
            if s[j] not in d:
                d[s[j]] = s[j]
                j += 1
                result = max(result, j - i)
            else:
                del d[s[i]]
                i += 1
        return result


